            //     </div>
            //   </div>
            // </div>

            <section class="p-4">
              <div class="container">
                <div class="row">
                  <div class="col-md-4">
                    <div class="card dest-card">
                      <div>
                        <img
                          src={"/images/" + data.imageName}
                          class="img-fluid dest-img"
                          alt=""
                        />
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </section>
            
          );
        })}
      </div>
    </div>
  );
}

export default Viewone;
